			<tr><td>TKN              <td class=number> 35
			<tr><td>NH<sub>4</sub>-N <td class=number> 25
			<tr><td>Alkalinity       <td class=number> 140 as CaCO3
			<tr><td>bCOD/BOD ratio   <td class=number> 1.6
